INSERT INTO `field_data_body` VALUES ('node','page',0,1,1,'und',0,'Western Sports Limited was established in 1974 to provide sports gear and equipments. We carry all the names you have come to know including Puma, Addidas, Butterfly, Nike, Wilson, Yonex and Umbro. We have several branches island wide to serve you better.\r\n\r\nLorem ipsum dolor sit amet, consectetuer adipiscing elit, sed diam nonummy nibh euismod tincidunt ut laoreet dolore magna aliquam erat volutpat.\r\n\r\nUt wisi enim ad minim veniam, quis nostrud exerci tation ullamcorper suscipit lobortis nisl ut aliquip ex ea commodo consequat. Duis autem vel eum iriure dolor in hendrerit in vulputate velit esse molestie consequat, vel illum dolore eu feugiat nulla facilisis at vero eros et accumsan et iusto odio dignissim qui blandit praesent luptatum zzril delenit augue duis dolore te feugait nulla facilisi. Nam liber tempor cum soluta nobis eleifend option congue nihil imperdiet doming id quod mazim placerat facer possim assum. Typi non habent claritatem insitam; est usus legentis in iis qui facit eorum claritatem. Investigationes demonstraverunt lectores legere me lius quod ii legunt saepius.\r\n\r\nClaritas est etiam processus dynamicus, qui sequitur mutationem consuetudium lectorum. Mirum est notare quam littera gothica, quam nunc putamus parum claram, anteposuerit litterarum formas humanitatis per seacula quarta decima et quinta decima. Eodem modo typi, qui nunc nobis videntur parum clari, fiant sollemnes in futurum.','','full_html'),('node','webform',0,2,2,'und',0,'<div id=\"go-right\">\r\n<div id=\"map\"></div>\r\n</div>\r\n<p style=\"font-size:15px\">Need more info on any of our products? Drop us a line.</p>','','full_html'),('node','page',0,3,3,'und',0,'<style>\r\ntd{\r\nvertical-align: middle;\r\nheight: 160px;\r\ntext-align: center;\r\n}\r\n</style>\r\n<table style=\"width:100%;\">\r\n<tr><td><a href=\"#\" target=\"_blank\"><img src=\"/sites/default/files/affil/adidas.jpg\" /></a></td><td><a href=\"#\" target=\"_blank\"><img src=\"/sites/default/files/affil/wilson.jpg\" /></a></td><td><a href=\"#\" target=\"_blank\"><img src=\"/sites/default/files/affil/umbro.jpg\" /></a></td></tr>\r\n<tr><td><a href=\"#\" target=\"_blank\"><img src=\"/sites/default/files/affil/puma.png\" /></a></td><td><a href=\"#\" target=\"_blank\"><img src=\"/sites/default/files/affil/yonex.jpg\" /></a></td><td><a href=\"#\" target=\"_blank\"><img src=\"/sites/default/files/affil/nike.jpg\" /></a></td></tr>\r\n<tr><td><a href=\"#\" target=\"_blank\"></a></td><td><a href=\"#\" target=\"_blank\"><img src=\"/sites/default/files/affil/joma.jpg\" /></a></td><td><a href=\"#\" target=\"_blank\"></a></td></tr>\r\n</table>','','full_html'),('node','shoe',0,4,4,'und',0,'The Nike Mercurial Vapor Superfly III: Designed for explosive play\r\n\r\nTake advantage of superior speed. With a ground-gripping traction system, the Nike Mercurial Vapor Superfly III FG Men\'s Soccer Cleat is the epitome of velocity and precision on short-grass fields.\r\n\r\nBenefits\r\nFirm-ground (FG) cleats for use on short-grass fields that may be slightly wet, but rarely muddy\r\nSnug fit locks in the foot for instant acceleration\r\nSofter, thinner upper for enhanced touch\r\nVapor traction system for improved grip\r\nLightning heel graphic for increased visibility\r\n\r\nTraction\r\nThe Mercurial Vapor Superfly III Cleat features pressure-activated Nike SENSE technology that adjusts stud length according to surface type for the relentless grip and acceleration the game demands. Dual-density studs and Nike\'s Vapor Traction system allow for effortless cutting and instant acceleration, while cored out studs in the heel reduce weight and deliver rock-solid stability and added quickness. For instant bursts of speed, this cleat also has toe-off traction in the forefoot.\r\n\r\nSupport\r\nFor ultra-lightweight support, this men\'s cleat has innovative Flywire in a streamlined upper. Made of super-strong, thin nylon fibers that help hold the foot in place, Flywire reduces the cleat\'s weight, adjusts to the foot, provides support and increases ball feel.\r\n\r\nLightweight Design\r\nContributing to this boot\'s unprecedented light weight is a carbon-fiber chassis, which strips weight to the absolute minimum while maximizing strength. The contoured design mirrors the shape of the foot for an enhanced fit and feel, and the lightweight, perforated sockliner provides low-profile cushioning and support while reducing cleat pressure.\r\n\r\nOrigins\r\nNike\'s design team worked closely with athletes including Cristiano Ronaldo, Zlatan Ibrahimovic and Alexandre Pato throughout the design process to create a cleat that enables toe-off acceleration and minimizes slippage in game-changing situations. Players emphasized that acceleration around a defender is just as important as beating him in a straight line. Through additional research, Nike found there were 845 slipping events over 63 games, or roughly 14 per game--a costly price that designers were determined to minimize with the creation of the Nike Mercurial Vapor Superfly III.\r\n\r\nAdditional Details\r\nBrushed finish reduces ball slip for enhanced control in a variety of conditions\r\nFoam heel collar has a clear sticky coating that helps provide a snug, secure fit','','full_html'),('node','shoe',0,12,12,'und',0,'Lorem ipsum dolor sit amet, consectetuer adipiscing elit, sed diam nonummy nibh euismod tincidunt ut laoreet dolore magna aliquam erat volutpat.\r\n\r\nUt wisi enim ad minim veniam, quis nostrud exerci tation ullamcorper suscipit lobortis nisl ut aliquip ex ea commodo consequat. Duis autem vel eum iriure dolor in hendrerit in vulputate velit esse molestie consequat, vel illum dolore eu feugiat nulla facilisis at vero eros et accumsan et iusto odio dignissim qui blandit praesent luptatum zzril delenit augue duis dolore te feugait nulla facilisi. Nam liber tempor cum soluta nobis eleifend option congue nihil imperdiet doming id quod mazim placerat facer possim assum.\r\n\r\nTypi non habent claritatem insitam; est usus legentis in iis qui facit eorum claritatem. Investigationes demonstraverunt lectores legere me lius quod ii legunt saepius. Claritas est etiam processus dynamicus, qui sequitur mutationem consuetudium lectorum. Mirum est notare quam littera gothica, quam nunc putamus parum claram, anteposuerit litterarum formas humanitatis per seacula quarta decima et quinta decima.','','filtered_html'),('node','shoe',0,13,13,'und',0,'The Puma v1.11 has been one of the most eye-catching football boots across Europe over the past nine months, since the release of the Green/Navy/White launch colourway. Puma\'s growing roster of deadly goal-scorers including Sergio Aguero and Mario Gomez have ensured the brands popular speed silo stays firmly in the spotlight.\r\n\r\nIn addition, the new v1.11 soccer cleats enable greater playing stability, through an external heel counter and a Pebax frame that provides support to the outsole. The midfoot area is reinforced with a TPU composite which secures further stability and helps to avoid midfoot bending. This increased stability also enables an optimal traction as well as manoeuvrability, provided through the pointed stud configuration featured on this new boot.\r\n\r\nThe Puma v1.11 football boots are the third generation boot that uses the special UNI technology, where the upper material is stitched rather than glued to the sole, which marries the boot together for a consistent fit. This combines with an anti-slip insert under the heel for a boot that will not only fit snug but will support the foot and prevent slippage. \r\n\r\nThe central lacing system has been made easier to access with the introduction of a new lace-cover, probably the most striking feature. The lace-cover provides a unique look and is adorned with the Puma motif. It is held down by an elastic strap and a TriHook fastener to ensure a snug fit and tighter fastening than the previous v1.10.','','filtered_html'),('node','article',0,14,14,'und',0,'Lorem ipsum dolor sit amet, consectetuer adipiscing elit, sed diam nonummy nibh euismod tincidunt ut laoreet dolore magna aliquam erat volutpat. Ut wisi enim ad minim veniam, quis nostrud exerci tation ullamcorper suscipit lobortis nisl ut aliquip ex ea commodo consequat.\r\n\r\nDuis autem vel eum iriure dolor in hendrerit in vulputate velit esse molestie consequat, vel illum dolore eu feugiat nulla facilisis at vero eros et accumsan et iusto odio dignissim qui blandit praesent luptatum zzril delenit augue duis dolore te feugait nulla facilisi.\r\n\r\nNam liber tempor cum soluta nobis eleifend option congue nihil imperdiet doming id quod mazim placerat facer possim assum. Typi non habent claritatem insitam; est usus legentis in iis qui facit eorum claritatem. Investigationes demonstraverunt lectores legere me lius quod ii legunt saepius. Claritas est etiam processus dynamicus, qui sequitur mutationem consuetudium lectorum. Mirum est notare quam littera gothica, quam nunc putamus parum claram, anteposuerit litterarum formas humanitatis per seacula quarta decima et quinta decima. Eodem modo typi, qui nunc nobis videntur parum clari, fiant sollemnes in futurum.','','full_html'),('node','article',0,15,15,'und',0,'<p style=\"margin-top:20px\"><img src=\"/sites/default/files/affil/v1.jpg\" style=\"width:100%\" /></p>\r\nNike have completely re-engineered the speed boot for even better performance – ditching the Sense Stud, FlyWire and the Carbon Fibre from the previous versions. The aim? Simple. To deliver explosive speed. And here they are folks – in all their Mango / Dark Gray glory!\r\n\r\nFor over a decade, the Mercurial boot has been all about ground breaking innovation. Cutting edge technology has consistently produced a boot that delivers on lightweight, comfort and responsive performance.\r\n\r\nSet to be worn by the likes of Ronaldo, Neymar, Ibrahimovic and Walcott for the 2012/13 season, the Mercurial Vapor takes performance innovation to the next level with this boot built for explosive speed.\r\n\r\nThink Mercurial and you think both innovation and style. The substance is within the boots DNA, the new Vapor 8 delivers the ultimate in fit, touch and traction. \r\n\r\nA striking new design features a bright mango colourway with a new visual signature on the heel to stand out on pitch. \r\n\r\n<p style=\"text-align: center\"><iframe width=\"790\" height=\"432\" src=\"http://www.youtube.com/embed/fi2iIYRBOxY\" frameborder=\"0\" allowfullscreen></iframe></p>\r\n\r\nRedesigned to create a snug upper while locking down the foot and preventing unwanted movement, Nike’s new Anatomic Last takes the fit of the boot to a new level of support and stability. This effect is enhanced by a more minimalist and softer heel counter, maximizing both comfort and fit. \r\n\r\nA sleeker and closer feel is achieved by a special toe-box reinforcer, making the boot more comfortable around the toe. The new Vapor also features a thinner, stronger and lighter Teijin Microfiber reducing the weight to 185g — just right for a speed with the optimal levels of support and durability.\r\n\r\nThe Teijin Microfiber upper has a suede-like finish, increasing ball control and touch. It also gives the boots immediacy, eliminating any need for them to be broken in. These are ready to go…now. \r\n\r\nTraction is everything when the final goal is explosive speed. It’s hard enough beating eleven opponents; you don’t need the turf to be against you too. This is a boot built for speed but one that also recognises that footballers don’t run in straight lines. \r\n\r\n<img src=\"/sites/default/files/affil/v11.jpg\" style=\"width:100%;border:1px solid #CCC\" />\r\n\r\nTwin studs at the back allow for a quick release from the turf and the asymmetric design of the stud configuration delivers an explosive start. Sharper blades cut through the turf, allowing for game-altering changes in direction.\r\n\r\nA revolutionary glass chassis with double layer composite provides stability on the mid-foot while optimizes energy return on the forefoot for explosive acceleration. \r\n\r\nCrafted using all of Nike’s expertise, the new Mercurial Vapor 8 is a forward thinking, modern boot for the player who is ready to explode into action. \r\n\r\nCristiano Ronaldo has always worn the Mercurial and the boots have once again met his very exacting standards “This boot is perfect for me. I can get an edge on defenders, knowing that the boot will give me the speed and traction I need without compromising support, control or, of course, style.”','','full_html'),('node','clothing',0,16,16,'und',0,'The Arsenal Replica: Team pride and tradition\r\n\r\nThe 2011/12 Arsenal Replica Men\'s Soccer Jersey pays tribute to the “Great Innovator\'s” influence with the traditional red body and white sleeves that have come to define the team. Distinctive design details and breathability offer comfort on and off the field.\r\n\r\nBenefits\r\nPerformance fabric to help keep you dry and comfortable\r\nMesh panels for ventilation\r\nConsidered Design for high performance and low environmental impact\r\n\r\nDesign\r\nThe 2011/12 Arsenal Replica Soccer Jersey features a silicone screenprint club crest at the left chest, and behind it—on the inside, close to the heart of those dedicated to the game—“Victoria Concordia Crescit” (Victory Comes from Harmony) is printed. A screenprint sponsor logo spans the center chest for a nod to the backers of the team, while a club graphic and league badge adorn the center back and right sleeve. And, this jersey has finished hems to prevent fraying and deliver a polished look.\r\n\r\nFabric\r\nLightweight and breathable, this Arsenal jersey was designed with the environment in mind. Its sweat-wicking Dri-FIT fabric was made from the equivalent of eight recycled plastic bottles. Dri-FIT helps keep you dry and comfortable by wicking sweat away from the skin to the fabric\'s surface, where it quickly evaporates. Dri-FIT mesh panels down the sides enhance ventilation in high-heat areas.\r\n\r\nAdditional Details\r\nCrew neck\r\nAuthentic jock tag at left hem\r\nSwoosh design trademark at right chest\r\nFabric: Dri-FIT 100% recycled polyester\r\nMachine wash\r\nImported','','full_html'),('node','accessory',0,17,17,'und',0,'<div style=\"text-align:center\">\r\n<object style=\"height: 308px; width: 547px;\" >\r\n<param name=\"movie\" value=\"http://www.youtube.com/v/TtfJAyjkkGs?version=3&feature=player_embedded&autohide=1\">\r\n<param value=\"transparent\" name=\"wmode\">\r\n<param name=\"allowFullScreen\" value=\"true\">\r\n<param name=\"allowScriptAccess\" value=\"always\">\r\n<embed src=\"http://www.youtube.com/v/TtfJAyjkkGs?version=3&feature=player_embedded&autohide=1\" type=\"application/x-shockwave-flash\" allowfullscreen=\"true\" allowScriptAccess=\"always\" width=\"547\" height=\"308\">\r\n</object>\r\n</div>\r\n\r\n<p>HOW IT WORKS\r\nNike+ FuelBand tracks your activity through a sport-tested accelerometer. Then translates every move into NikeFuel. Nike+ FuelBand tracks running, walking, dancing, basketball - and dozens of everyday actions. It also syncs up with a motivational web and mobile experience. So put it on and get moving.</p>\r\n\r\n<p style=\"clear:both\">TRACK YOUR PROGRESS\r\nSync your Nike+ FuelBand every day to visualize your results. See your peaks, your valleys, and your progress.</p>\r\n\r\n<div style=\"float:left;\"><img src=\"/sites/default/files/nf1.png\" /></div>\r\n<p style=\"margin-left:250px\" >IT STARTS WITH A GOAL\r\nHow active do you want to be? Set your Daily Goal and Nike+ FuelBand tracks your progress, lighting up from red to green throughout the day. Get to green and you\'ve hit your goal.\r\n</p>\r\n\r\n<div style=\"float:right;margin: 80px 0 0 20px;\"><img src=\"/sites/default/files/nf2.png\" /></div>\r\n<p style=\"clear:left;padding-top: 15px;\">MAKE LIFE A SPORT\r\nTurn every day into a game. Challenge yourself to capture records, reach new milestones, and unlock special achievements. Go on a streak by seeing how many days in a row you can hit your daily goal.</p>','','full_html'),('node','shoe',0,18,18,'und',0,'The Nike Mercurial Vapor Superfly III: Designed for explosive play\r\n\r\nTake advantage of superior speed. With a ground-gripping traction system, the Nike Mercurial Vapor Superfly III FG Men\'s Soccer Cleat is the epitome of velocity and precision on short-grass fields.\r\n\r\nBenefits\r\nFirm-ground (FG) cleats for use on short-grass fields that may be slightly wet, but rarely muddy\r\nSnug fit locks in the foot for instant acceleration\r\nSofter, thinner upper for enhanced touch\r\nVapor traction system for improved grip\r\nLightning heel graphic for increased visibility\r\n\r\nTraction\r\nThe Mercurial Vapor Superfly III Cleat features pressure-activated Nike SENSE technology that adjusts stud length according to surface type for the relentless grip and acceleration the game demands. Dual-density studs and Nike\'s Vapor Traction system allow for effortless cutting and instant acceleration, while cored out studs in the heel reduce weight and deliver rock-solid stability and added quickness. For instant bursts of speed, this cleat also has toe-off traction in the forefoot.\r\n\r\nSupport\r\nFor ultra-lightweight support, this men\'s cleat has innovative Flywire in a streamlined upper. Made of super-strong, thin nylon fibers that help hold the foot in place, Flywire reduces the cleat\'s weight, adjusts to the foot, provides support and increases ball feel.\r\n\r\nLightweight Design\r\nContributing to this boot\'s unprecedented light weight is a carbon-fiber chassis, which strips weight to the absolute minimum while maximizing strength. The contoured design mirrors the shape of the foot for an enhanced fit and feel, and the lightweight, perforated sockliner provides low-profile cushioning and support while reducing cleat pressure.\r\n\r\nOrigins\r\nNike\'s design team worked closely with athletes including Cristiano Ronaldo, Zlatan Ibrahimovic and Alexandre Pato throughout the design process to create a cleat that enables toe-off acceleration and minimizes slippage in game-changing situations. Players emphasized that acceleration around a defender is just as important as beating him in a straight line. Through additional research, Nike found there were 845 slipping events over 63 games, or roughly 14 per game--a costly price that designers were determined to minimize with the creation of the Nike Mercurial Vapor Superfly III.\r\n\r\nAdditional Details\r\nBrushed finish reduces ball slip for enhanced control in a variety of conditions\r\nFoam heel collar has a clear sticky coating that helps provide a snug, secure fit','','full_html'),('node','article',0,19,19,'und',0,'CALABAR High captured their 23rd lien on the Mortimer Geddes Trophy for the ISSA/GraceKennedy Boys\' and Girls\' Athletics Championships at the National Stadium to celebrate their 100th anniversary in fine style.\r\n\r\nThe green and black-clad standard bearers from Red Hills Road amassed 287.5 to beat Kingston College (KC) 265, and dethroned champion Jamaica College (JC) 220.5, with Wolmer\'s Boys\' fourth on 140.\r\n\r\nIt was \"Utmost to the Highest\", a fitting tribute to the school established by the Jamaica Baptist Union in 1912 for the children of Baptist ministers and the children of the poor blacks and was named after the former slave port Calabar in Nigeria.\r\n\r\nIt topped a fine week in which they also won the Schools\' Challenge Quiz title for the fifth time for the double triumph referred to as \"Quamps\".\r\n\r\nCalabar, who last won the title four years ago in 2008, are second only to KC\'s 31 titles and ahead of JC on 21 victories. They finished in style with a wonderful victory in the 4x400m in a creditable 3:10.19.\r\n\r\nMoments after capturing yet another event, Bob Marley\'s Rat Race echoed from the sound system to a loud roar from the Calabar faithful. Only recently, Calabar had to close after being infested by rats.\r\n\r\nThe Michael Clarke-coached boys showed good all-round strength, especially in the field events, with Fedrick Dacres, Ashinia Miller, Demar Robinson, Shamar Kitson and Andre Beckford, while Michael O\'Haro copped a fine display on the track, winning the Class Two 110m hurdles and the 200m.\r\n\r\nBut Calabar didn\'t have things their own way and had to stave off a renewed challenge from KC who scored a pair of victories in the 800m and the Class One 4x100m relay.\r\n\r\nKC\'s victory in 1,600m Medley Relay reignited the famed Purples\' chances, with the anchor leg runner erasing a 40-metre deficit held by JC had to win in 3:30.55.\r\n\r\nCalabar\'s skipper Demar Robinson, however, gave his team some breathing space after outjumping David Hall of KC on the countback in an intense high jump battle. Both leaped 2.10m.\r\n\r\nCalabar, who started the day ahead by 16 points, drew first blood in the Class Three 400m, grabbing 14 points after Aykeeme Francis won in 50.96 and teammate Gawayne Porter placed fourth, and went on to earn 31 points to JC\'s 24 and KC\'s 10.\r\n\r\nCalabar\'s Javon Francis upset the favourite in Class One 400m, winning in 47.58 ahead of Lennox Williams of Manchester High, 47.85, and KC\'s Jovan Williams, 48.04.\r\n\r\nKC responded in the 800m, winning the Class One and Two events en route to 34 points, compared to Calabar\'s 22.\r\n\r\nThe outstanding Sanj Powell used his blinding burst of speed to win the Class One race in 1.53.17, ahead of Danielle Richards of Holmwood, 1:53.40, and teammate Alex Saunders, who set a blistering pace, in third with 1:53.47.\r\nPowell was winning his second event, having broken the 2,000m steeplechase Open record on Thursday night.\r\n\r\nJC\'s Waquar DaCosta ended his \'Champs\' career in a disappointing fourth spot with 1:54.54. DaCosta had dominated both Class Three and Class Two.\r\n\r\nChad Miller of KC won the Class Two event in 1:56.63, ahead of Alex Hutton of Calabar, 1:56.97, while third went to Ricardo McKenzie of Cornwall College in 1:57.68. KC\'s Miguel Morrison was fifth and earned four points.\r\nIn Class Three, Calabar garnered 13 points courtesy of first- and fifth-place finishes. Chevenne Hamilton won in 2:05.04.\r\n\r\nAfter 28 finals, Calabar were leading by 24.5 points with 204.5 to KC\'s 180 and JC falling to third with 140. But Calabar didn\'t rest on their laurels. Immediately, the impressive Michael O\'Haro, who had earlier won the 110m hurdles, completed his double by sprinting clear of his rivals in 21.56 seconds in the 200m.\r\n\r\nThe fancied JC pair of Rohan Walker and Devaughn Baker were second and fourth, respectively.\r\n\r\nMeanwhile, the outstanding Delano Williams of Munro Colege completed the Class One sprint double, easing to 21.18 to win the 200m.\r\n\r\nKC\'s Travane Morrison finished well for second in 21.67, ahead of Nethanee Mitchell-Blake of JC, 21.72. Jevaughn Minzie of Bog Walk was fourth in 21.74.\r\n\r\nRaheem Chambers of St Jago also won his second gold, stopping the clock at 22.78, well ahead of Munro\'s Rushane Edwards, 23.01, and KC\'s Jhevaughn Matherson, 23.25.\r\n\r\nStefan Fennell, who will be taking up a scholarship to the University of Arkansas despite having a year left at KC, won the Class One 110m hurdles in 13.74, ahead of arch-rival Yanick Hart of Wolmer\'s, 14.12.','','full_html'),('node','article',0,20,20,'und',0,'<table width=\"100%\">\r\n<tr><th>Boys</th><th>Points</th><th>Girls</th><th>Points</th></tr>\r\n<tr><td>Calabar High School</td><td>287.5</td><td>Edwin Allen High School</td><td>346</td></tr>\r\n<tr><td>Kingston College</td><td>265</td><td>Holmwood Technical</td><td>222</td></tr>\r\n<tr><td>Jamaica College</td><td>221.5</td><td>St. Jago High</td><td>173</td></tr>\r\n<tr><td>Wolmers Boys School</td><td>140</td><td>Vere Technical High</td><td>146</td></tr>\r\n<tr><td>Munro College</td><td>94</td><td>Hydel High S